import { Table } from "reactstrap";
import { thead, tbody } from "variables/general";
import React from "react";
import { graphql } from 'react-apollo';
import  queries  from 'queries/Empresas.jsx';

//Se importa el query
const getEmpresas =queries

class TablesEmpresas extends React.Component {

    showEmpresas() {

        const data = (this.props.empresadata)
        //  console.log(data.data);
        // if (data.loading) {
            // return(<div>Loading ...</div>)
        // } else {
            return data.data.map((prop, key) => {
                return (
                    <tbody>
                        <th key={key} className="text-right">
                            {prop.nombre}
                        </th>
                        <th key={key} className="text-right">
                            {prop.correo}
                        </th>
                        <th key={key} className="text-right">
                            {prop.canton}
                        </th>
                        <th key={key} className="text-right">
                            {prop.provincia}
                        </th>
                    </tbody>
                );
            })
        // }
    }

    render() {
        return (
            <>
                <Table responsive>
                    <thead className="text-primary">
                        <tr>
                            {thead.map((prop, key) => {
                                if (key === thead.length - 1)
                                    return (
                                        <th key={key} className="text-right">
                                            {prop}
                                        </th>
                                    );
                                return <th key={key}>{prop}</th>;
                            })}
                        </tr>
                    </thead>
                    {this.showEmpresas()}
                </Table>
            </>
        );
    }
}

// export default graphql(getEmpresas)(TablesEmpresas);
export default TablesEmpresas;
